import React, { Component } from 'react';
import { Accordion, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import VrTrailApi from '../api/VrTrailApi';
import Charts from './Charts';

class RunListEntry extends Component {
    constructor(props){
        super(props);

        // initiiere einen leeren state
        this.state = {
            run: props.run,
            runID: props.run.getID(),
            runDate: props.run.getDate(),

            task1: null,
            task1Duration: null,

            task2: null,
            task2Duration: null,
            task2WrongTiles: null,
            task2DurationTiletoTile: null,

            task3: null,
            task3Duration: null,
            task3WrongAssignment: null,

            loadingInProgress: false,
            error: null
        };
    }

    /** Handles onChange events of the underlying ExpansionPanel */
    expansionPanelStateChanged = () => {
    this.props.onExpandedStateChange(this.props.run);
    }

    //Handles the onClick event of the show profil button
    showProfilButtonClicked = (event) => {
      event.stopPropagation();
      this.setState({
        showRunDialog: true
      });
    }

    getRunByIdUser = () => {
        VrTrailApi.getAPI().getRunByIdUser(this.state.run.iduser)
        .then(runBO =>
            this.setState({
                run: runBO,
                error: null,
                loadingInProgress: false,
            })).catch(e =>
                this.setState({
                    run: null,
                    error: e,
                    loadingInProgress: false,
                }));
        this.setState({
            error: null,
            loadingInProgress: true,
            loadingKonversationenError: null
        });
      }

      getTask1ById = () => {
        VrTrailApi.getAPI().getTask1ById(this.state.runID)
        .then(taskBO =>
            this.setState({
                task1: taskBO,
                task1Duration: taskBO.duration,
                error: null,
                loadingInProgress: false,
            })).catch(e =>
                this.setState({
                  task1: null,
                    error: e,
                    loadingInProgress: false,
                }));
        this.setState({
            error: null,
            loadingInProgress: true,
            loadingKonversationenError: null
        });
      }

      getTask2ById = () => {
        VrTrailApi.getAPI().getTask2ById(this.state.runID)
        .then(taskBO =>
            this.setState({
                task2: taskBO,
                task2Duration: taskBO.duration,
                task2WrongTiles: taskBO.wrongtiles,
                task2DurationTiletoTile: taskBO.durationTiletoTile, 
                error: null,
                loadingInProgress: false,
            })).catch(e =>
                this.setState({
                  task2: null,
                    error: e,
                    loadingInProgress: false,
                }));
        this.setState({
            error: null,
            loadingInProgress: true,
            loadingKonversationenError: null
        });
      }

      getTask3ById = () => {
        VrTrailApi.getAPI().getTask3ById(this.state.runID)
        .then(taskBO =>
            this.setState({
                task3: taskBO,
                task3Duration: taskBO.duration,
                task3WrongAssignment: taskBO.wrongAssignment,
                error: null,
                loadingInProgress: false,
            })).catch(e =>
                this.setState({
                  task3: null,
                    error: e,
                    loadingInProgress: false,
                }));
        this.setState({
            error: null,
            loadingInProgress: true,
            loadingKonversationenError: null
        });
      }

  /** Handles the onClose event of the CustomerForm */
  runDialogClosed = (profil) => {
    // customer is not null and therefor changed
    if (profil) {
      this.setState({

        showRunDialog: false
      });
    } else {
      this.setState({
        showRunDialog: false
      });
    }
  }

    componentDidMount() {
      // load Profil
      this.getRunByIdUser();
      this.getTask1ById();
      this.getTask2ById();
      this.getTask3ById();
    }

    render(){
          const { runDate, task1Duration, task2Duration, task2WrongTiles, task2AdurationTiletoTile, task3Duration, task3WrongAssignment } = this.state;
          return (
            <div>
                <Accordion.Body>
                      Datum: {runDate}
                      <br/><br/>
                      <Card>
                        <Card.Body>
                          <Card.Subtitle>Einstiegsslevel (Task 1)</Card.Subtitle>
                          <Card.Text>
                            Dauer: {task1Duration} Minuten
                          </Card.Text>
                        </Card.Body>
                      </Card>
                      <br/>
                      <Card>
                        <Card.Body>
                          <Card.Subtitle>Task 2</Card.Subtitle>
                          <Card.Text>
                            Dauer: {task2Duration} Minuten <br/>
                            Falsche Fliesen: {task2WrongTiles} <br/>
                            Dauer von Fliese zu Fliese: {task2AdurationTiletoTile}
                          </Card.Text>
                        </Card.Body>
                      </Card>
                      <br/>
                      <Card>
                        <Card.Body>
                          <Card.Subtitle>Task 3</Card.Subtitle>
                          <Card.Text>
                            Dauer: {task3Duration} Minuten <br/>
                            Falsche Zuordnung: {task3WrongAssignment}
                          </Card.Text>
                        </Card.Body>
                      </Card>
                </Accordion.Body>
            </div>
          );
        }
}

export default RunListEntry;
